import React from 'react'
import {Navigate } from 'react-router-dom';
const Landing = () => {

    if(localStorage.token)
    {
        return(
            <div>
                Landing
            </div>
        );
    }
    else {
        return <Navigate to="/Login" />;
    }
}

export default Landing;
